import React, { useEffect, useState } from 'react';

const TechCollection = () => {
  const [icons, setIcons] = useState([]);

  useEffect(() => {
    const loadIcons = () => {
      // Dynamically import all SVG files in the specified directory
      const context = require.context('../assets', false, /\.svg$/);
      const TechCollectionComponent = context.keys().map( async (key) =>{
        return (await import(`../assets/${key.slice(2)}`)).ReactComponent;
      })

      setIcons(TechCollectionComponent);
    };

    loadIcons();
  }, []);

  return (
    <div>
      {
        icons.map((Icon, index) => <div key={index}>{Icon}</div>)
      }
    </div>
  );
};

export default TechCollection;



